// Function to generate product cards
function generateProductCards(products, containerId) {
    const container = document.getElementById(containerId);

    products.forEach(product => {
        const productCard = document.createElement('div');
        productCard.className = 'product';

        const image = document.createElement('img');
        image.src = product.image;
        image.alt = product.name;

        const productContent = document.createElement('div');
        productContent.className = 'product-content';

        const productName = document.createElement('h3');
        productName.textContent = product.name;

        const productPrice = document.createElement('p');
        productPrice.textContent = product.price;

        const addToCartBtn = document.createElement('button');
        addToCartBtn.className = 'btn';
        addToCartBtn.textContent = 'Add to Cart';
    
        // When the "Add to Cart" button is clicked, call the addToCart function with the corresponding product
        addToCartBtn.addEventListener('click', function () {
            addToCart(product);
        });
        
        productContent.appendChild(productName);
        productContent.appendChild(productPrice);
        productContent.appendChild(addToCartBtn);

        productCard.appendChild(image);
        productCard.appendChild(productContent);

        container.appendChild(productCard);
    });
}

// Call the function to generate product cards for women and men
generateProductCards(womenProducts, 'women-products');
generateProductCards(menProducts, 'men-products');




